import React, { useState, useEffect} from 'react';
import connect from '@vkontakte/vk-connect';
import ReactDOM from 'react-dom';
import { Panel, PanelHeader, Epic, Tabbar, TabbarItem, View, Stack, Page } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

import Icon28NewsfeedOutline from '@vkontakte/icons/dist/28/newsfeed_outline.js';
import Icon28AddOutline from '@vkontakte/icons/dist/28/add_outline.js';

const Panel1 = ({ id, navigator }) => (
  <Panel id={id}>
      <PanelHeader>
          Панель 1
      </PanelHeader>
      <Group>
          <Button onClick={() => navigator.go("panel2")}>
              Вперед
          </Button>
      </Group>
  </Panel>
);

const Panel2 = ({ id, navigator }) => (
  <Panel id={id}>
      <PanelHeader>
          Панель 2
      </PanelHeader>
      <Group>
          <Button onClick={() => navigator.goBack()}>
              Назад
          </Button>
      </Group>
  </Panel>
);
 export default App;
